-- DDL

-- Cleanup
DROP TABLE IF EXISTS Needs;
DROP TABLE IF EXISTS Attends;
DROP TABLE IF EXISTS Class;
DROP TABLE IF EXISTS Equipment;
DROP TABLE IF EXISTS Type;
DROP TABLE IF EXISTS Gym;
DROP TABLE IF EXISTS Member;
DROP TABLE IF EXISTS Instructor;

-- Creating tables
CREATE TABLE Instructor (
    ID INT,
    name VARCHAR(200) NOT NULL,
    phone INT NOT NULL UNIQUE,
    PRIMARY KEY(ID)
);

CREATE TABLE Member (
    ID INT,
    name VARCHAR(200) NOT NULL,
    phone INT NOT NULL UNIQUE,
    start_date DATE NOT NULL,
    quit_date DATE NULL,
    IID INT NULL REFERENCES Instructor(ID),      -- Trains relation
    PRIMARY KEY(ID)
);

CREATE TABLE Gym (
    ID INT,
    address VARCHAR(200) NOT NULL,
    email VARCHAR(200) NOT NULL,
    PRIMARY KEY(ID)
);

CREATE TABLE Type (
    ID INT,
    name VARCHAR(200) NOT NULL,
    capacity INT NOT NULL,
    PRIMARY KEY(ID)
);

CREATE TABLE Equipment (
    ID INT,
    name VARCHAR(200) NOT NULL,
    price INT NOT NULL,
    PRIMARY KEY(ID)
);

CREATE TABLE Class (
    ID INT,
    IID INT NOT NULL REFERENCES Instructor(ID),  -- Leads relation
    TID INT NOT NULL REFERENCES Type(ID),        -- Is of relation
    GID INT NOT NULL REFERENCES Gym(ID),         -- Is at relation
    date DATE NOT NULL,
    minutes INT NOT NULL,
	PRIMARY KEY(ID)
);

CREATE TABLE Attends (
    MID INT REFERENCES Member(ID),
    CID INT REFERENCES Class(ID),
    rating INT NOT NULL,
    PRIMARY KEY(MID, CID)
);

CREATE TABLE Needs (
    TID INT REFERENCES Type(ID),
    EID INT REFERENCES Equipment(ID),
    quantity INT NOT NULL,
    PRIMARY KEY(TID, EID)
);


